                <div class="container-fluid">
                    <span id='span1' class="navbar-text text-light">
                        Designed by Abduvakhob | Copiright 2023 
                    </span>
                    <i id='icon' class="bi bi-instagram text-light"><Link></Link></i>
                    
                </div>
            </nav>
        </footer>

    )
}




